// 선 그리기 함수 호출
drawLine(placeLat,placeLng);

// 선 그리기 함수 정의
function drawLine(placeLat,placeLng) {
   if (placeLat.length !== placeLng.length) {
        return;
    }

    deleteClickLine(); // 기존의 선을 제거합니다
    deleteDistance(); // 기존의 거리 정보를 제거합니다
    deleteCircleDot(); // 기존의 클릭 지점을 제거합니다

    clickLine = new kakao.maps.Polyline({
        map: map, // 선을 표시할 지도입니다
        path: [], // 선을 구성하는 좌표 배열을 초기화합니다
        strokeWeight: 3, // 선의 두께입니다
        strokeColor: '#db4040', // 선의 색깔입니다
        strokeOpacity: 1, // 선의 불투명도입니다
        strokeStyle: 'solid' // 선의 스타일입니다
    });

    for (var i = 0; i < placeLat.length; i++) {
		
        var position = new kakao.maps.LatLng(placeLat[i], placeLng[i]);
        var path = clickLine.getPath(); // 선의 좌표 배열을 가져옵니다
        path.push(position); // 위치를 좌표 배열에 추가합니다
        clickLine.setPath(path); // 선의 좌표 배열을 설정합니다

        var distance = Math.round(clickLine.getLength()); // 선의 길이를 계산합니다
        
		// 첫 번째 위치일 때와 마지막 위치일 때 표시
        if (i == 0) {
            displayCircleDot(position, distance, true); // 첫 번째 위치
        } else if (i == placeLat.length - 1) {
            displayCircleDot(position, distance, false); // 마지막 위치
        }
			
    }
}

// 필요한 함수들 정의
function deleteClickLine() {
    if (clickLine) {
        clickLine.setMap(null);
        clickLine = null;
    }
}

function deleteDistance() {
    if (distanceOverlay) {
        distanceOverlay.setMap(null);
        distanceOverlay = null;
    }
}

function deleteCircleDot() {
    dots.forEach(function(dot) {
        dot.setMap(null);
    });
    dots = [];
}

function displayCircleDot(position, distance, isStart) {
	var content;
    if (isStart) {
        content = '<div class="dotOverlay">출발</div>';
    } else {
        content = '<div class="dotOverlay">거리: ' + distance + 'm</div>';
    }
    var circleDot = new kakao.maps.CustomOverlay({
        map: map,
        position: position,
        content: content,
        yAnchor: 1
    });
    dots.push(circleDot);
}














// 마우스 우클릭 하여 선 그리기가 종료됐을 때 호출하여 
// 그려진 선의 총거리 정보와 거리에 대한 도보, 자전거 시간을 계산하여
// HTML Content를 만들어 리턴하는 함수입니다
function getTimeHTML(distance) {

    // 도보의 시속은 평균 4km/h 이고 도보의 분속은 67m/min입니다
    var walkkTime = distance / 67 | 0;
    var walkHour = '', walkMin = '';

    // 계산한 도보 시간이 60분 보다 크면 시간으로 표시합니다
    if (walkkTime > 60) {
        walkHour = '<span class="number">' + Math.floor(walkkTime / 60) + '</span>시간 '
    }
    walkMin = '<span class="number">' + walkkTime % 60 + '</span>분'

    // 자전거의 평균 시속은 16km/h 이고 이것을 기준으로 자전거의 분속은 267m/min입니다
    var bycicleTime = distance / 227 | 0;
    var bycicleHour = '', bycicleMin = '';

    // 계산한 자전거 시간이 60분 보다 크면 시간으로 표출합니다
    if (bycicleTime > 60) {
        bycicleHour = '<span class="number">' + Math.floor(bycicleTime / 60) + '</span>시간 '
    }
    bycicleMin = '<span class="number">' + bycicleTime % 60 + '</span>분'

    // 거리와 도보 시간, 자전거 시간을 가지고 HTML Content를 만들어 리턴합니다
    var content = '<ul class="dotOverlay distanceInfo">';
    content += '    <li>';
    content += '        <span class="label">총거리</span><span class="number">' + distance + '</span>m';
    content += '    </li>';
    content += '    <li>';
    content += '        <span class="label">도보</span>' + walkHour + walkMin;
    content += '    </li>';
    content += '    <li>';
    content += '        <span class="label">자전거</span>' + bycicleHour + bycicleMin;
    content += '    </li>';
    content += '</ul>'

    return content;
}
